import React from "react";

export default function videoList(props) {
  const videoList = props.videoList.map(video => {
    return (
      <div className="video-list__single">
        <div className="video-list__single-left">
          <img src={`${video.img}`} />
        </div>
        <div className="video-list__single-right">
          <p className="video-list__single-right-title">{video.title}</p>
          <p className="video-list__single-right-channel">{video.channel}</p>
        </div>
      </div>
    );
  });

  return (
    <div className="video-list">
      <h1 className="video-list__heading">NEXT VIDEO</h1>
      {videoList}
    </div>
  );
}
